import './index.css';

function App() {
  return (
    <div class="grid grid-cols-1 gap-4 content-center m-5">
      <div>
        <h1 class="text-2xl font-bold font-sans">My Tasks</h1>
      </div>
      <div class="form-check flex flex-row ">
        <input type="checkbox" />
        <p class="">Add task</p>
      </div>
    </div>
  );
}

export default App;
